import React, { useEffect, useState, useRef } from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaLinkedin, FaTwitter, FaEnvelope, FaHeart } from 'react-icons/fa';
import ProjectCard from '../components/ProjectCard';
import axios from 'axios';

// Typewriter Component
const Typewriter = ({ text, speed = 75, className = "" }) => {
  const [displayText, setDisplayText] = useState('');
  const [currentIndex, setCurrentIndex] = useState(0);

  useEffect(() => {
    if (currentIndex < text.length) {
      const timeout = setTimeout(() => {
        setDisplayText(prev => prev + text[currentIndex]);
        setCurrentIndex(prev => prev + 1);
      }, speed);
      return () => clearTimeout(timeout);
    }
  }, [currentIndex, text, speed]);

  return (
    <span className={className}>
      {displayText}
      <span className="animate-pulse">|</span>
    </span>
  );
};

// Home Component
const Home = () => {
  const [featuredProjects, setFeaturedProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  const skills = [
    'React', 'Node.js', 'MongoDB', 'JavaScript', 'TypeScript', 'Python',
    'Tailwind CSS', 'Express.js', 'Git', 'Docker', 'AWS', 'PostgreSQL'
  ];

  useEffect(() => {
    const fetchFeaturedProjects = async () => {
      try {
        const response = await axios.get('/api/projects/featured');
        setFeaturedProjects(response.data);
      } catch (error) {
        console.error('Error fetching featured projects:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchFeaturedProjects();
  }, []);

  const textRef = useRef(null);
  const [position, setPosition] = useState({ x: 0, y: 0 });

  const handleMouseMove = (e) => {
    const rect = textRef.current.getBoundingClientRect();
    const x = e.clientX - rect.left - rect.width / 2;
    const y = e.clientY - rect.top - rect.height / 2;
    setPosition({ x, y });
  };

  const handleMouseLeave = () => {
    setPosition({ x: 0, y: 0 });
  };

  const style = {
    transform: `translate(${position.x * 0.3}px, ${position.y * 0.3}px)`,
    transition: "transform 0.1s ease-out",
    display: "inline-block",
  };

  useEffect(() => {
    const nameElement = document.querySelector('.custom-cursor');
    if (nameElement) {
      const handleMouseEnter = () => {
        document.body.style.cursor = `url('/cursor.png'), auto`;
      };
      const handleMouseLeave = () => {
        document.body.style.cursor = 'auto';
      };

      nameElement.addEventListener('mouseenter', handleMouseEnter);
      nameElement.addEventListener('mouseleave', handleMouseLeave);

      return () => {
        nameElement.removeEventListener('mouseenter', handleMouseEnter);
        nameElement.removeEventListener('mouseleave', handleMouseLeave);
      };
    }
  }, []);

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <section className="section-padding bg-white">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center"
          >
            <h1 className="text-4xl md:text-6xl font-bold text-gray-900 mb-6 font-playwrite">
              Hi, I'm
              <Typewriter
                text="Prince Sharma"
                speed={150}
                className="relative group inline-block custom-cursor text-5xl md:text-6xl mb-6 font-bold text-gray-900 font-playwrite"
              />
            </h1>
            <p className="text-xl md:text-2xl text-gray-600 mb-8 max-w-3xl mx-auto font-playwrite">
              Full Stack Developer passionate about creating beautiful and functional web applications
            </p>
            <div className="flex justify-center space-x-4 mb-8">
              <a href="http://github.com/prince0k" target="_blank" rel="noopener noreferrer" className="text-gray-600 hover:text-primary-600 transition-colors duration-200"><FaGithub size={24} /></a>
              <a href="https://www.linkedin.com/in/prince-sharma" target="_blank" rel="noopener noreferrer" className="text-gray-600 hover:text-primary-600 transition-colors duration-200"><FaLinkedin size={24} /></a>
              <a href="https://x.com/princes65258114" target="_blank" rel="noopener noreferrer" className="text-gray-600 hover:text-primary-600 transition-colors duration-200"><FaTwitter size={24} /></a>
              <a href="mailto:prince4sharmaa123@gmail.com" className="text-gray-600 hover:text-primary-600 transition-colors duration-200"><FaEnvelope size={24} /></a>
            </div>
            <div className="flex flex-col sm:flex-row gap-4 justify-center font-playwrite">
              <a href="/projects" className="btn-primary">View My Work</a>
              <a href="/contact" className="btn-secondary">Get In Touch <FaHeart className="inline text-red-500 mx-2 my-2" /></a>
            </div>
          </motion.div>
        </div>
      </section>

      {/* About Section */}
      <section className="section-padding">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            className="grid md:grid-cols-2 gap-12 items-center"
          >
            <div>
              <h2 className="text-3xl font-bold text-gray-900 mb-6 font-playwrite">About Me</h2>
              <p className="text-lg text-gray-600 mb-6 font-playwrite">
                I'm a passionate full-stack developer with experience in building modern web applications.
                I love solving complex problems and creating user-friendly interfaces that make a difference.
              </p>
              <p className="text-lg text-gray-600 mb-6 font-playwrite">
                With expertise in React, Node.js, and MongoDB, I specialize in creating scalable and
                maintainable applications that deliver exceptional user experiences.
              </p>
              <div className="flex flex-wrap gap-2">
                {skills.map((skill, index) => (
                  <span
                    key={index}
                    className="bg-gray-100 text-gray-700 px-3 py-1 rounded-full text-sm font-medium"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </div>

            {/* Image with Magnetic Text */}
            <section className="min-h-screen flex items-center justify-center bg-gray-900 text-white p-10">
              <div className="relative w-full max-w-4xl h-96 rounded-xl overflow-hidden shadow-2xl">
                <div
                  className="absolute inset-0 bg-cover bg-center"
                  style={{
                    backgroundImage: `url('https://images.unsplash.com/photo-1506905925346-21bda4d32df4?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80')`
                  }}
                ></div>
                <div className="absolute inset-0 bg-black bg-opacity-50" />
                <div className="absolute inset-0 flex items-center justify-center z-10">
                  <span
                    ref={textRef}
                    onMouseMove={handleMouseMove}
                    onMouseLeave={handleMouseLeave}
                    style={style}
                    className="text-4xl md:text-5xl font-bold cursor-pointer"
                  >
